import React from "react";

export default function UsersStatistics() {
    function searchUser() {
        let piece = document.getElementById('usernameInput').value;
        fetch("http://localhost:18080/users/piece", {
            method: 'GET',
            headers: new Headers({
                "Authorization": sessionStorage.jwtToken
            })
        })
    }

    return (
        <div>
            <div style={{position: "absolute", top: "80px", width: "93%", left: '80px'}}>
                <input id="usernameInput" type="text" className="form-control" placeholder="Title" onChange={searchUser}/>
            </div>
        </div>
    )
}
